// This is a conceptual example and won't run directly.
// You'll need to install React, Tailwind CSS, and set up your project.

import React, { useState, useEffect } from 'react';

const GoMapsSearch = () => {
  const [location, setLocation] = useState({ lat: null, lng: null });
  const [searchQuery, setSearchQuery] = useState('');
  const [places, setPlaces] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  // Replace with your actual GoMaps API Key
  const GOMAPS_API_KEY = 'AlzaSya5QD-sqq93fLWzpsX9LYdlTZqugV3vLXQ';

  // Function to get current location
  const getCurrentLocation = () => {
    setLoading(true);
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(
        (position) => {
          setLocation({
            lat: position.coords.latitude,
            lng: position.coords.longitude,
          });
          setLoading(false);
        },
        (err) => {
          setError('Unable to retrieve your location. Please enable location services.');
          setLoading(false);
          console.error(err);
        }
      );
    } else {
      setError('Geolocation is not supported by your browser.');
      setLoading(false);
    }
  };

  // Function to search for places
  const searchPlaces = async () => {
    if (!location.lat || !location.lng || !searchQuery) {
      setError('Please provide a location and a search query.');
      return;
    }

    setLoading(true);
    setError(null);
    setPlaces([]);

    const apiUrl = `https://maps.gomaps.pro/maps/api/place/nearbysearch/json?location=${location.lat},${location.lng}&keyword=${encodeURIComponent(searchQuery)}&radius=50000&key=${GOMAPS_API_KEY}`;

    try {
      const response = await fetch(apiUrl, {
        method: 'GET',
        headers: {
          'Accept': 'application/json',
        },
      });

      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }

      const data = await response.json();
      if (data.status === 'OK') {
        setPlaces(data.results);
      } else {
        setError(`Error from GoMaps API: ${data.status}`);
      }
    } catch (err) {
      setError(`Failed to fetch places: ${err.message}`);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    // You might want to automatically get location on component mount
    // getCurrentLocation();
  }, []);

  return (
    <div className="min-h-screen bg-gray-100 flex items-center justify-center p-4">
      <div className="bg-white p-8 rounded-lg shadow-lg max-w-md w-full">
        <h1 className="text-2xl font-bold text-gray-800 mb-6 text-center">Find Places Nearby</h1>

        <div className="mb-4">
          <label htmlFor="search" className="block text-gray-700 text-sm font-bold mb-2">
            What are you looking for? (e.g., e-waste center, kabaddi wale)
          </label>
          <input
            type="text"
            id="search"
            className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
            value={searchQuery}
            onChange={(e) => setSearchQuery(e.target.value)}
            placeholder="e-waste center or kabaddi wale"
          />
        </div>

        <div className="mb-6">
          <button
            onClick={getCurrentLocation}
            className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline w-full"
            disabled={loading}
          >
            {loading && !location.lat ? 'Getting Location...' : 'Use Current Location'}
          </button>
          <p className="text-sm text-gray-600 mt-2 text-center">
            {location.lat && location.lng ? `Current Location: ${location.lat.toFixed(4)}, ${location.lng.toFixed(4)}` : 'No location set'}
          </p>
        </div>

        <div className="mb-6">
          <label htmlFor="manual-location" className="block text-gray-700 text-sm font-bold mb-2">
            Or enter location manually (latitude, longitude):
          </label>
          <input
            type="text"
            id="manual-location"
            className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
            value={location.lat && location.lng ? `${location.lat},${location.lng}` : ''}
            onChange={(e) => {
              const parts = e.target.value.split(',').map(part => parseFloat(part.trim()));
              if (parts.length === 2 && !isNaN(parts[0]) && !isNaN(parts[1])) {
                setLocation({ lat: parts[0], lng: parts[1] });
              } else {
                setLocation({ lat: null, lng: null }); // Clear if invalid
              }
            }}
            placeholder="e.g., 40.71,-74.01"
          />
        </div>

        <button
          onClick={searchPlaces}
          className="bg-green-500 hover:bg-green-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline w-full"
          disabled={loading || !searchQuery || !location.lat || !location.lng}
        >
          {loading && searchQuery ? 'Searching...' : 'Search'}
        </button>

        {error && (
          <p className="text-red-500 text-sm mt-4 text-center">{error}</p>
        )}

        {places.length > 0 && (
          <div className="mt-6 border-t border-gray-200 pt-6">
            <h2 className="text-xl font-bold text-gray-800 mb-4">Results:</h2>
            <ul>
              {places.map((place) => (
                <li key={place.place_id} className="mb-4 p-4 border border-gray-200 rounded-lg">
                  <h3 className="text-lg font-semibold text-gray-900">{place.name}</h3>
                  <p className="text-gray-600">{place.vicinity}</p>
                  {place.rating && (
                    <p className="text-gray-600">Rating: {place.rating} ({place.user_ratings_total || 0} reviews)</p>
                  )}
                  {place.opening_hours && place.opening_hours.open_now !== undefined && (
                    <p className={`text-sm ${place.opening_hours.open_now ? 'text-green-600' : 'text-red-600'}`}>
                      {place.opening_hours.open_now ? 'Open Now' : 'Closed'}
                    </p>
                  )}
                  {place.url && (
                    <a
                      href={place.url}
                      target="_blank"
                      rel="noopener noreferrer"
                      className="text-blue-500 hover:underline text-sm"
                    >
                      View on Map
                    </a>
                  )}
                </li>
              ))}
            </ul>
          </div>
        )}

        {places.length === 0 && !loading && !error && searchQuery && location.lat && location.lng && (
          <p className="text-gray-600 text-center mt-4">No results found for your search.</p>
        )}
      </div>
    </div>
  );
};

export default GoMapsSearch;
